<script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/api/v1/h5p/ajax?action=","contents":{"cid-1226018862":{"displayOptions":{"copy":false,"copyright":false,"embed":false,"export":false,"frame":false,"icon":false},"fullScreen":"1","jsonContent":"{\"timeline\":{\"defaultZoomLevel\":\"0\",\"height\":600,\"asset\":{},\"date\":[{\"asset\":{},\"startDate\":\"1999\",\"headline\":\"Gründung von Alibaba\",\"text\":\"<p>Jack Ma gründet mit seinem Team in seinem Apartment in Hangzhou die Alibaba Group. </p>\\n\"},{\"asset\":{\"media\":\"https://youtu.be/iEq9tzzJYJA\",\"caption\":\"Was ist Taobao? - ein Werbevideo von Alibaba.com\"},\"startDate\":\"2003\",\"headline\":\"Taobao.com geht online\",\"text\":\"<p>Im Vergleich zu eBay hat Taobao.com ein eigenes Bezahl- und Kommunmikationssystem. Außerdem ist es kostenfrei. </p>\\n\\n<p>Das Bezahlsystem Alipay wächst schnell zur größten Bezahlplattform Chinas. </p>\\n\"},{\"asset\":{},\"startDate\":\"2008\",\"headline\":\"Alibaba wächst und investiert in eine bessere Infrastruktur.\",\"text\":\"<p>Dazu schickt das Unternehmen z.B. Ausbilder in die Dörfer und bietet dort Schulungen an.</p>\\n\\n<p> </p>\\n\"},{\"asset\":{},\"startDate\":\"2014\",\"headline\":\"Alibaba geht an die New Yorker Börse.\",\"text\":\"\"},{\"asset\":{},\"startDate\":\"2009\",\"headline\":\"Es existieren drei Taobao-Dörfer in ganz China.\",\"text\":\"<p>Um ein Taobao-Dorf zu werden müssen die Verkäufer als Bewohner des Dorfes registriert sein und dort auch arbeiten. Außerdem muss das Dorf einen gewissen Jahresumsatz über Taobao.com erwirtschaften sowie das Kriterium erfüllen, dass mindestens 10% der Haushalte im Dorf als Online Verkäufer registriert sind. </p>\\n\"},{\"asset\":{},\"startDate\":\"2017\",\"headline\":\"Es existieren 2118 Taobao-Dörfer in 24 Provinzen.\",\"text\":\"<p>Der rasche Anstieg an Taobao-Dörfern kann auf unterschiedliche Faktoren zurückgeführt werden. Zum Einen gibt es einen Boom im Onlinehandel generell, zum Anderen wächst damit einhergehend auch die logistische Infrastruktur (z.B. Bezahlsysteme, Lieferservices), was den Onlinehandel zugänglicher machen. Schlussendlich spielen auch soziale Faktoren in den Dörfern eine Rolle. </p>\\n\"},{\"asset\":{},\"startDate\":\"2019\",\"headline\":\"4310 Taobao-Dörfer existieren heute.\",\"text\":\"\"}],\"language\":\"de\",\"headline\":\"Entwicklung des E-Commerce in China\",\"text\":\"\",\"era\":[{\"startDate\":\"1996\",\"endDate\":\"2000\",\"headline\":\"Startphase\",\"text\":\"<div>Unternehmen beginnen mit E-Commerce</div>\\n\"},{\"startDate\":\"2001\",\"endDate\":\"2007\",\"headline\":\"Beschleunigte Entwicklungsphase\",\"text\":\"<div>Der Wettbewerb intensiviert sich (z.B. Alibaba und eBay).</div>\\n\"},{\"startDate\":\"2008\",\"endDate\":\"2014\",\"headline\":\"Standardisierung und Förderung\",\"text\":\"<div>Der erste Fünfjahresplan zur Förderung von E-Commerce wird verabschiedet.</div>\\n\"},{\"startDate\":\"2014\",\"headline\":\"Internationalisierung\",\"text\":\"\"}]}}","library":"H5P.Timeline 1.1","contentUrl":".","metadata":{"license":"U","title":"Taobao","defaultLanguage":"en"},"scripts":["/api/v1/h5p/libraries/TimelineJS-1.1/js/storyjs-embed.js?version=1.1.1","/api/v1/h5p/libraries/TimelineJS-1.1/timeline.js?version=1.1.1","/api/v1/h5p/libraries/H5P.Timeline-1.1/timeline.js?version=1.1.21"],"styles":["/api/v1/h5p/libraries/H5P.Timeline-1.1/timeline.css?version=1.1.21"],"url":".","exportUrl":"/api/v1/h5p/download/1226018862"}},"core":{"scripts":["/api/v1/h5p/core/js/jquery.js?version=1.24-master","/api/v1/h5p/core/js/h5p.js?version=1.24-master","/api/v1/h5p/core/js/h5p-event-dispatcher.js?version=1.24-master","/api/v1/h5p/core/js/h5p-x-api-event.js?version=1.24-master","/api/v1/h5p/core/js/h5p-x-api.js?version=1.24-master","/api/v1/h5p/core/js/h5p-content-type.js?version=1.24-master","/api/v1/h5p/core/js/h5p-confirmation-dialog.js?version=1.24-master","/api/v1/h5p/core/js/h5p-action-bar.js?version=1.24-master","/ap
